export const note = [
  {
    id: 1,
    body: "### this is just in!",
  },
  { id: 2, body: "a" },
  { id: 3, body: "b" },
  { id: 4, body: "c" },
  { id: 5, body: "d" },
  { id: 6, body: "e" },
];
